import React from 'react';
import './ErrorPage.css'; 
import ErrorImage from '../assets/404.png';

const NotFound = () => {
  return (
    <div className="not-found-container">
      <div className="image-container">
        <img src={ErrorImage} alt="404 이미지" />
      </div>
    </div>
  );
};

export default NotFound;
